    - ID: "30b0a514-dc94-432c-9655-8c01e474023f"
      Hint: ExtendedContent
      Value: "<p>Treat your pet with Kaytee Timothy Baked Biscuits, a naturally nutritious snack with a purpose. Timothy Baked Biscuits contain stabilized vitamin C to support your pet&rsquo;s wellness and healthy diet with a flavorful punch of real cranberry and orange. Made with fiber-rich Timothy hay and real fruit, Kaytee Timothy Baked Biscuits are a fun, flavorful way to add healthy and tasty enrichment to your small pet&rsquo;s diet. They are ideal for bonding and playtime and help to satisfy a small animal's natural desire to chew. Timothy Baked Biscuits can be served daily as a snack for rabbits, guinea pigs, chinchillas, and other small animals.</p>"
